import React from "react";

function OfferCard({ offer }) {
  const { name, style, description } = offer;

  const deleteClassButton = (offer) => {
    if (offer.user_can_modify) {
      return (
        <button
          className="px-4 py-1 bg-red-400 text-white"
          onClick={() => console.log(offer.id)}
        >
          Delete Class
        </button>
      );
    }
  };
  return (
    <div>
      <h4>{name}</h4>
      <h5>{style}</h5>
      <p>{description}</p>
      <button
        className="px-4 py-1 bg-red-400"
        onClick={() => console.log(offer.id)}
      >
        Delete Class
      </button>
    </div>
  );
}

export default OfferCard;
